Dan yang terakir saya mau bahas  adalah..... Harga nyaa,,, jengjeng... kalau udah ngomongin duit harus serius nih,, Jadi gini,, harga desain Scandhinavian itu mahal.. tapi gampang banget dimurahin tanpa mengurangi kesan keindahan yang udah saya jelasin panjang lebar diatas. Kenapa bisa gitu?? karena penggunaan bahan kayu itu sebenarnya NGGAK perlu, alias bisa diganti bahan lain yang lebih murah tanpa mengurangi kekuatanya!! Trus kalau kesan serat nya, tinggal pake HPL atau veneer.. dijamin akan jauh lebih murah dan bisa lebih cantik lagi..
nah kira kira itu yang mau saya jelasin kekalian bahwa desain itu asik....
